import{_ as t,c as o,o as n,ah as l}from"./chunks/framework.PvdZnrZd.js";const c=JSON.parse('{"title":"POSTNL SHIPPING","description":"POSTNL SHIPPING","frontmatter":{"title":"POSTNL SHIPPING","description":"POSTNL SHIPPING","date":"2025-07-18T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/shipping/postnl.md","filePath":"zenith/featured-app/shipping/postnl.md"}'),a={name:"zenith/featured-app/shipping/postnl.md"};function i(r,e,p,s,h,g){return n(),o("div",null,[...e[0]||(e[0]=[l('<p>The <a href="/zenith/introduction/">Multi-vendor Marketplace</a> has come up with another shipping feature app here namely <strong>PostNL Shipping</strong>.</p><p>With this featured app, the admin can allow sellers to manage the order fulfillment via PostNL and automatically generate shipping labels of the orders.</p><p>NOTE:- This PostNL shipping feature app is available only with the</p><p>Multivendor <strong>Pro</strong> <strong>Plan</strong> ($60/month). Moreover, you need to enable the <strong><a href="/zenith/featured-app/overview.html">Shipping</a></strong> Add-on for FREE from the ‘Feature Apps’ section of the app.</p><p>MARK:- Access to Shipping requires your Shopify store to be on the plan that supports <strong>Real-Time Carrier-Calculated Shipping</strong>.</p><p>This feature app will charge you a minimal amount of <strong>$10 per month</strong> over and above your current Multivendor plan.</p><p><strong>NOTE</strong>:- Dutch language is now supported in Shipment Type of PostNL Shipping.</p><h2 id="how-to-activate-postnl-shipping" tabindex="-1">How to Activate PostNL Shipping? <a class="header-anchor" href="#how-to-activate-postnl-shipping" aria-label="Permalink to &quot;How to Activate PostNL Shipping?&quot;">​</a></h2><p>To enable this feature within your app, all you need to do is to visit the “<strong>Featured Apps</strong>” section of the admin panel and enable it from there.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/featuredapps.webp" alt="Feature App-shipping"></p><p>Once you click on “Feature Apps”, you will get the list of apps listing in this section. Now, you can scroll down to get the <strong>PostNL</strong> feature and click on the <strong>enable</strong> button.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/postn.webp" alt="Screenshot-1"></p><p>Click the <strong>Enable</strong> button to activate the feature app.</p><p>In this way, you can enable the feature within your Multivendor App.</p><h2 id="workflow" tabindex="-1">Workflow <a class="header-anchor" href="#workflow" aria-label="Permalink to &quot;Workflow&quot;">​</a></h2><p>Admin End:-</p><p>As soon as you enable this feature app, a new sub-menu gets added in the Configuration menu of the app i.e. PostNL Configuration.</p><p>Note:- You need to have an account on PostNL to configure the details in the app.</p><p>Before this, You need to visit the Shipping Configuration and <strong>enable the PostNL Shipping</strong> as shown in the below screenshot:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/enablepostnl.webp" alt="Screenshot-2020-07-02T131214.415"></p><p>As soon as you activate the PostNL Shipping, you can proceed to configure the PostNL details. Go to Configurations&gt;&gt;<strong>PostNL Configuration</strong>.</p><p>You need to enter the PostNL API key, Customer Number &amp; Customer Code that you get from your PostNL account.</p><p>Configure Available Days for Delivery i.e. how many days from the current date you want to allow sellers to deliver the order to the customers.</p><p>Choose domestic shipping service timings when the order is to be delivered.<br> Enable International shipping in case you have configured the same on the PostNL shipping portal.</p><p>Holiday Sorting:- You can enable this if you want the order to be delivered on the holidays also as per the Belgium/Netherlands calendar.</p><p>Select a country for the order shipment and language in which you want to show the tracking order details.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/postnlconfigadmin.webp" alt="admin panel"></p><p>Once you configure these details, the sellers will also get the option to enable the PostNL shipping from the <strong>Shipping Configuration</strong> menu of their seller panel.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/enablepostnlseller.webp" alt="seller end"></p><h2 id="global-shipping-configuration" tabindex="-1">Global Shipping Configuration <a class="header-anchor" href="#global-shipping-configuration" aria-label="Permalink to &quot;Global Shipping Configuration&quot;">​</a></h2><p>Also, the sellers need to configure the Global Shipping Configuration details from here:<br> Shipping Duration:-</p><p>The seller needs to enable this tab if he/she wants to handover the packet to the PostNL for shipment on the same day of order fulfillment.</p><p>Moreover, the seller needs to configure the delivery details based on the shipment location.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/globalconfig.webp" alt="Shipping_Configuration_Seller_•_Multivendor_MarketPlace-2"></p><p>Now, the shipping must be required for the products.</p><p>The seller will add/edit the product and select any shipping method enabled in the app based on which shipping rates will be calculated at checkout.</p><h2 id="shipping-label-generation" tabindex="-1">Shipping Label Generation <a class="header-anchor" href="#shipping-label-generation" aria-label="Permalink to &quot;Shipping Label Generation&quot;">​</a></h2><p>Both admin and seller can generate the shipping label for the fulfilled orders. Admin can configure the shipping Label details.</p><p>Seller needs to follow these steps to generate shipping labels:</p><ul><li>Login to Multi-vendor <strong>Seller</strong> <strong>Panel</strong>.</li><li>Go to <strong>Orders</strong>.</li><li>Visit the <strong>Order Listing</strong> section.</li><li>Select the <strong>Order</strong> for which You want to <strong>Generate Shipping Label.</strong></li><li>Proceed to fulfill the order.</li></ul><p>Clicking the Fulfill button, you need to select the PostNL as the shipping method.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/orderfullpage.webp" alt="Order_Details_Seller_•_Multivendor_MarketPlace-2"></p><p>Select PostNL Shipping and choose the delivery date &amp; time frame:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/07/Order_Details_Seller_%E2%80%A2_Multivendor_MarketPlace-3-763x1024.png" alt="Order_Details_Seller_•_Multivendor_MarketPlace-3"></p><p>Then, the seller will click &quot;Agree and Fulfill&quot; button.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/07/Order_Details_Seller_%E2%80%A2_Multivendor_MarketPlace-4-1200x590.png" alt="Order_Details_Seller_•_Multivendor_MarketPlace-4"></p><h2 id="allow-sellers-to-select-delivery-method-on-fulfillment" tabindex="-1">Allow Sellers to Select Delivery Method On Fulfillment <a class="header-anchor" href="#allow-sellers-to-select-delivery-method-on-fulfillment" aria-label="Permalink to &quot;Allow Sellers to Select Delivery Method On Fulfillment&quot;">​</a></h2><p>You can now allow your sellers to select a delivery method at the time of order fulfillment.</p><p>For this, you need to first enable the configuration from the <strong>PostNL Configuration</strong> menu on admin panel.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2021/04/screenshot-prnt.sc-2021.04.09-11_55_19-1200x561.png" alt="screenshot-prnt.sc-2021.04.09-11_55_19"></p><p>Now, once enabled, the seller will get the option to select shipping type while fulfilling an order.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2021/04/Screenshot-2-1200x568.png" alt="Screenshot-2"></p><p>Items is fulfilled.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/07/Order_Details_Seller_%E2%80%A2_Multivendor_MarketPlace-5-1200x588.png" alt="Order_Details_Seller_•_Multivendor_MarketPlace-5"></p><p>Moreover, the seller will then print the Shipping Label.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/generateshiipinglabel.webp" alt="Order_Details_Seller_•_Multivendor_MarketPlace-6"></p><p><strong>Shipping Label Generated:-</strong></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/07/Screenshot-2020-07-02T194201.401.png" alt="PostNL Shipping"></p><p>Customers can track shipment for all the upcoming orders fulfilled via PostNL shipping.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2021/06/screenshot-prnt.sc-2021.06.22-17_18_51-1200x600.png" alt=" PostNL shipping"></p><p>That&#39;s all about the PostNL Shipping feature App.</p><h2 id="demo" tabindex="-1">DEMO <a class="header-anchor" href="#demo" aria-label="Permalink to &quot;DEMO&quot;">​</a></h2><p>Link to check the demo of Multi-vendor Marketplace app for Shopify: <a href="https://multivendor-marketplace-5.myshopify.com/" target="_blank" rel="noreferrer">https://multivendor-marketplace-5.myshopify.com</a></p>',63)])])}const u=t(a,[["render",i]]);export{c as __pageData,u as default};
